import React from 'react';
import Head from 'next/head';
import PaginationStyles from './styles/PaginationStyles';

const Pagination = ({ page }) => (
  <PaginationStyles>
    <Head>
      <title>Bazzer.com | Page {page} of ___</title>
    </Head>
  </PaginationStyles>
);

export default Pagination;
